response.activities:
ТОВАРЫ ДЛЯ ДЕВОЧЕК:
Разнообразный ассортимент игрушек кукол (в том числе интерактивных и музыкальных), одежда к ним и аксуссуары: коляски, мебель, дома;

Наборы кометики, бижутерия, наборы докторов.

ТОВАРИ ДЛЯ МАЛЬЧИКОВ:
Гаражи, треки, железные дороги, паровозы, аэропорты;
Набори военные, полицейские, рыцарей, пиратов, инструментов;
Оружые на пульках, музыкальное;
Роботы, трансфореры;

РАЗВИВАЮЩИЕ игрушки, конструкторы, головоломки, логические игры, игрушки для самых маленьких.
